1) Для магистров до 30 лет — €28,350, для остальных — €37,296.
2) У меня нет оконченной магистратуры, со мной работает один человек вообще без высшего образования. Tax ruling при этом есть у обоих.

Резюмируя:
1) Транспортная система во всей стране быстрая, классная и удобная;
2) Поезда между городами ходят очень часто;
3) Основа транспортной системы внутри Амстердама — трамваи и велосипеды;
4) Велосипед позволяет добраться почти куда угодно в разумные сроки.
